// AddTriggerVersions adds the given related objects to the existing relationships
// of the trigger, optionally inserting them as new records.
// Appends related to o.R.TriggerVersions.
// Sets related.R.Trigger appropriately.
func (o *Trigger) AddTriggerVersions(ctx context.Context, exec boil.ContextExecutor, insert bool, related ...*TriggerVersion) error {
	var err error
	for _, rel := range related {
		if insert {
			rel.TriggerID = o.ID
			if err = rel.Insert(ctx, exec, boil.Infer()); err != nil {
				return errors.Wrap(err, "failed to insert into foreign table")
			}
		} else {
			updateQuery := fmt.Sprintf(
				"UPDATE \"trigger_version\" SET %s WHERE %s",
				strmangle.SetParamNames("\"", "\"", 1, []string{"trigger_id"}),
				strmangle.WhereClause("\"", "\"", 2, triggerVersionPrimaryKeyColumns),
			)
			values := []interface{}{o.ID, rel.ID}

			if boil.DebugMode {
				fmt.Fprintln(boil.DebugWriter, updateQuery)
				fmt.Fprintln(boil.DebugWriter, values)
			}

			if _, err = exec.ExecContext(ctx, updateQuery, values...); err != nil {
				return errors.Wrap(err, "failed to update foreign table")
			}

			rel.TriggerID = o.ID
		}
	}

	if o.R == nil {
		o.R = &triggerR{
			TriggerVersions: related,
		}
	} else {
		o.R.TriggerVersions = append(o.R.TriggerVersions, related...)
	}

	for _, rel := range related {
		if rel.R == nil {
			rel.R = &triggerVersionR{
				Trigger: o,
			}
		} else {
			rel.R.Trigger = o
		}
	}
	return nil
}

